int main()
{
	unsigned int x, n;
	bool odd=false;
	printf("Podaj liczbe do przesuniecia: ");
	scanf_s("%d", &x);
	printf("Twoja liczba binarnie: ");
	for (int i = 0;i < 32;i++) {
		printf("%d", !!((x << i) & 0x80000000));
	}
	printf("\n");
	printf("Podaj liczbe przesuniec: ");
	scanf_s("%d", &n);
	for (int i = 0;i < n;i++) {
		if (x % 2 == 1) {
			odd = true;
		}
		else {
			odd = false;
		}

		x >> 1;
		if (odd) {
			x * 0x80000000;
		}
	}
	printf("Twoja liczba binarnie: ");
	for (int i = 0;i < 32;i++) {
		printf("%d", !!((x << i) & 0x80000000));
	}
	printf("\n");
	system("pause");
    return 0;
}
